  [],\n\t\"revision_timestamp\": \"2015-05-06T21:08:39.842547\",\n\t\"name\": \"interfacial-design-of-composite-ablative-materials-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This Phase I Small Business Innovative Research
  project proposes to develop a multiscale computational methodology capable of accurate
  prediction of the properties and performance of insulating ablative materials that
  are used to protect the re-entry of vehicles from excessive thermal loads. In particular,
  this effort will focus on multi-million atom, reactive molecular dynamics (MD) simulations
  of pyrolysis of phenolic resins enhanced with carbon nanotubes (CNT). The results
  will reveal the role of CNT interface on the reaction and the thermo-mechanical
  properties. The derived interfacial strength characteristics will then be incorporated
  into continuum-level simulations. The outcome of Phase I will provide a benchmark
  to perform MD simulations on pyrolysis of resin composites and methodology development
  to link atomistic-level with continuum-level simulations. Phase II will involve
  MD simulations on multi-walled, functionalized CNTs in cross-linked resin, optimization
  of the multi-scale modeling methodology and experimental validation. The outcome
  of the multiscale computational program will involve a detailed parametric study
  to find optimal parameters at multiple scales including: nanofiller diameter size,
  volume fraction and functionalization of nanotubes and ?]m-sized carbon fibers.
  These parameters will be optimized to best meet Orion vehicle!&s TPS challenges.
  The team involves engineers from ACT and researchers from Rensselaer Polytechnic
  Institute.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
